import React, { Component } from 'react'

class Box extends Component {
    render() {
        return (
            <div className='box p-2'>
                <div className="img">
                    <img src={this.props.img} alt="service-img" />
                </div>
                <h3>{this.props.title}</h3>
                <p>{this.props.text}</p>
            </div>
        )
    }
}

export default Box;
